import React from 'react';
import {
  View,
  Text,
  ScrollView,
  TouchableOpacity,
  StyleSheet,
  Dimensions,
  Platform,
  Linking
} from 'react-native';
import { useNavigate } from 'react-router-dom';
import Footer from '../components/Footer';

const { width } = Dimensions.get('window');

const Careers = () => {
  const navigate = useNavigate();

  const handleBackToHome = () => {
    navigate('/');
  };

  const handleContact = () => {
    navigate('/#contact');
  }

  return (
    <View style={styles.container}>
      <View style={styles.navHeader}>
        <TouchableOpacity onPress={handleBackToHome} style={styles.backButton}>
          <Text style={styles.backArrow}>‚Üê</Text>
          <Text style={styles.backText}>Back to Home</Text>
        </TouchableOpacity>
      </View>

      <ScrollView
        style={styles.scrollView}
        contentContainerStyle={styles.scrollContent}
        showsVerticalScrollIndicator={false}
      >
        <View style={styles.heroSection}>
          <Text style={styles.pageTitle}>PARTNERSHIPS</Text>
          <View style={styles.fireBar} />
          <Text style={styles.pageSubtitle}>
            Building the future of startups, together
          </Text>
        </View>

        <View style={styles.introSection}>
          <Text style={styles.introText}>
            I'm always open to collaborating with like-minded founders, investors, and industry experts. If you have a project or idea that could benefit from my unique blend of technical and business expertise, I'd love to hear from you.
          </Text>
        </View>

        <View style={styles.benefitsContainer}>
          <Text style={styles.benefitsTitle}>Why Partner With Me?</Text>
          <View style={styles.benefitsGrid}>
            <View style={styles.benefitItem}>
              <Text style={styles.benefitIcon}>ü§ù</Text>
              <Text style={styles.benefitText}>A True Technical Co-Founder</Text>
            </View>
            <View style={styles.benefitItem}>
              <Text style={styles.benefitIcon}>üìà</Text>
              <Text style={styles.benefitText}>Accelerated MVP Development</Text>
            </View>
            <View style={styles.benefitItem}>
              <Text style={styles.benefitIcon}>üí°</Text>
              <Text style={styles.benefitText}>Strategic Product Direction</Text>
            </View>
            <View style={styles.benefitItem}>
              <Text style={styles.benefitIcon}>üí∞</Text>
              <Text style={styles.benefitText}>Investor & Network Access</Text>
            </View>
          </View>
        </View>

        <TouchableOpacity
          style={styles.applyButton}
          onPress={handleContact}
        >
          <Text style={styles.applyButtonText}>Let's Connect</Text>
          <Text style={styles.applyArrow}>‚Üí</Text>
        </TouchableOpacity>

        <Footer />
      </ScrollView>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#000000',
  },
  navHeader: {
    paddingTop: Platform.OS === 'web' ? 40 : 60,
    paddingHorizontal: width > 768 ? 40 : 20,
    paddingBottom: 20,
    borderBottomWidth: 2,
    borderBottomColor: '#FF4500',
    backgroundColor: 'rgba(0, 0, 0, 0.95)',
  },
  backButton: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  backArrow: {
    fontSize: 24,
    color: '#FF4500',
    marginRight: 10,
  },
  backText: {
    fontFamily: Platform.OS === 'web' ? "'Orbitron', sans-serif" : 'sans-serif',
    fontSize: 16,
    color: '#FF4500',
    fontWeight: '600',
  },
  scrollView: {
    flex: 1,
  },
  scrollContent: {
    flexGrow: 1,
  },
  heroSection: {
    paddingVertical: 60,
    paddingHorizontal: width > 768 ? 40 : 20,
    alignItems: 'center',
  },
  pageTitle: {
    fontFamily: Platform.OS === 'web' ? "'Press Start 2P', monospace" : 'monospace',
    fontSize: width > 768 ? 36 : 24,
    color: '#FF4500',
    textAlign: 'center',
    marginBottom: 20,
    textShadowColor: '#FF4500',
    textShadowOffset: { width: 0, height: 0 },
    textShadowRadius: 20,
  },
  pageSubtitle: {
    fontFamily: Platform.OS === 'web' ? "'Orbitron', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 18 : 14,
    color: '#FFA500',
    textAlign: 'center',
  },
  fireBar: {
    height: 4,
    width: 100,
    backgroundColor: '#FF4500',
    marginBottom: 20,
    borderRadius: 2,
    ...Platform.select({
      web: {
        boxShadow: '0 2px 20px rgba(255, 69, 0, 0.8)',
      },
      default: {
        shadowColor: '#FF4500',
        shadowOffset: { width: 0, height: 2 },
        shadowOpacity: 0.8,
        shadowRadius: 20,
      },
    }),
  },
  introSection: {
    paddingHorizontal: width > 768 ? 40 : 20,
    marginBottom: 50,
  },
  introText: {
    fontFamily: Platform.OS === 'web' ? "'Orbitron', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 16 : 14,
    color: '#CCCCCC',
    textAlign: 'center',
    maxWidth: 700,
    alignSelf: 'center',
    lineHeight: 24,
  },
  applyButton: {
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'center',
    backgroundColor: '#FF4500',
    paddingVertical: 12,
    paddingHorizontal: 20,
    borderRadius: 6,
    borderWidth: 2,
    borderColor: '#FFA500',
    alignSelf: 'center',
    marginBottom: 60,
  },
  applyButtonText: {
    fontFamily: Platform.OS === 'web' ? "'Press Start 2P', monospace" : 'monospace',
    fontSize: 12,
    color: '#000000',
    fontWeight: '900',
    marginRight: 8,
  },
  applyArrow: {
    fontSize: 18,
    color: '#000000',
  },
  benefitsContainer: {
    backgroundColor: 'rgba(255, 69, 0, 0.05)',
    borderRadius: 12,
    padding: 30,
    maxWidth: 900,
    alignSelf: 'center',
    borderWidth: 1,
    borderColor: '#8B0000',
    marginHorizontal: width > 768 ? 40 : 20,
    marginBottom: 60,
  },
  benefitsTitle: {
    fontFamily: Platform.OS === 'web' ? "'Press Start 2P', monospace" : 'monospace',
    fontSize: width > 768 ? 20 : 16,
    color: '#FF4500',
    textAlign: 'center',
    marginBottom: 30,
  },
  benefitsGrid: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    justifyContent: 'center',
    gap: 20,
  },
  benefitItem: {
    alignItems: 'center',
    width: width > 768 ? 200 : (width - 80) / 2,
  },
  benefitIcon: {
    fontSize: 32,
    marginBottom: 10,
  },
  benefitText: {
    fontFamily: Platform.OS === 'web' ? "'Orbitron', sans-serif" : 'sans-serif',
    fontSize: 13,
    color: '#FFA500',
    textAlign: 'center',
    fontWeight: '600',
  },
});

export default Careers;
